  function main() {
    for (let i = 0; i < 4; i++) {
        let pos = Math.floor(Math.random() * arrayEmojis.length);   // obtenemos una posición aleatoria dentro del array
        let emojiData = (arrayEmojis[pos]);                              // accedemos a esa posición.

        paintOptions(i, emojiData);
    }
  }


  function paintOptions(option, emojiData) {
    console.log("option: "+option);
    let newDiv = document.createElement("div");
    newDiv.id = `option${option}`;
    newDiv.classList.add("options");
    newDiv.setAttribute(`onClick`, `paintImage("${emojiData.hexcode}")`)
    let divText = document.createElement("p");
    divText.innerText = emojiData.annotation;
    newDiv.appendChild(divText);
    document.body.appendChild(newDiv);
  }

  function paintImage(imgCode) {
    let checker = document.getElementById("imgEmoji");
    if (checker){
        checker.remove();
    }
    let divImg = document.createElement("div");
    divImg.id = "imgEmoji"
    let img = document.createElement("img");
    img.src = `https://openmoji.org/data/color/svg/${imgCode}.svg`
    divImg.appendChild(img);
    document.body.appendChild(divImg);
  }

